    /**
     * Calculate profile completion percentage
     */
    calculateProfileCompletion() {
        console.log('calculateProfileCompletion called');
        // Prevent unnecessary calculations if profile is not loaded
        if (!this.doctorProfile) {
            this.profileCompletion = 0;
            return;
        }
        const totalFields = 10; // Total number of profile fields
        let completedFields = 0;
        // Check basic information
        if (this.doctorProfile.firstName)
            completedFields++;
        if (this.doctorProfile.lastName)
            completedFields++;
        if (this.doctorProfile.email)
            completedFields++;
        if (this.doctorProfile.contactNumber)
            completedFields++;
        if (this.doctorProfile.specialization)
            completedFields++;
        if (this.doctorProfile.qualifications?.length > 0)
            completedFields++;
        if (this.doctorProfile.professionalBio)
            completedFields++;
        if (this.doctorProfile.hospitalAddresses?.length > 0)
            completedFields++;
        if (this.doctorProfile.affiliations?.length > 0)
            completedFields++;
        if (this.doctorProfile.certifications?.length > 0)
            completedFields++;
        const newCompletion = Math.round((completedFields / totalFields) * 100);
        // Only update if the value has changed
        if (this.profileCompletion !== newCompletion) {
            this.profileCompletion = newCompletion;
        }
    }
