    /**
     * Get error message for form field
     */
    getErrorMessage(fieldName) {
        // Optimize to prevent change detection issues
        const control = this.profileForm.get(fieldName);
        if (!control?.errors || !control.touched) {
            return '';
        }
        const errors = control.errors;
        if (errors['required'])
            return 'This field is required';
        if (errors['email'])
            return 'Please enter a valid email address';
        if (errors['pattern'])
            return 'Please enter a valid phone number';
        if (errors['maxlength'])
            return `Maximum length is ${errors['maxlength'].requiredLength} characters`;
        if (errors['min'])
            return `Minimum value is ${errors['min'].min}`;
        if (errors['max'])
            return `Maximum value is ${errors['max'].max}`;
        return '';
    }
    /**
     * Add item to array field
     */
    addArrayItem(fieldName, value) {
        const currentValue = this.profileForm.get(fieldName)?.value || [];
        if (value.trim() && !currentValue.includes(value.trim())) {
            this.profileForm.patchValue({
                [fieldName]: [...currentValue, value.trim()]
            });
        }
    }
    /**
     * Remove item from array field
     */
    removeArrayItem(fieldName, index) {
        const currentValue = this.profileForm.get(fieldName)?.value || [];
        const newValue = currentValue.filter((_, i) => i !== index);
        this.profileForm.patchValue({
            [fieldName]: newValue
        });
    }
